export const Header = () => {
    return (
        <header>
            <div className="container">
                <div className="inner-content">

                    <table>
                        <th><Link to="/Add" onClick={() => window.scroll(0, 0)}>(NOT) PirateBay</Link></th>
                    </table>
                    <table>
                        <th><PageLayout /></th>
                    </table>


                </div>
            </div>
        </header>
    )
}
